   "source": [
    "## Ejercicio 1\n",
    "\n",
    "La infección por Hantavirus, cuya mayor expresión de gravedad es el Síndrome Cardiopulmonar (SCPH), es una zoonosis endémica de Chile causada por el virus Andes (ANDV). El ANDV es un virus de genoma ARN segmentado y con envoltura lipídica, miembro del género Orthohantavirus y la familia Hantaviridae. Este virus tiene como reservorio natural el roedor Oligoryzomys longicaudatus conocido como “ratón colilargo o cola larga”, cuyo hábitat se encuentra distribuido desde el valle de Copiapó en la III Región a Campos de Hielo Sur (50° S).\n",
    "\n",
    "El ministerio de salud le encarga a usted realizar un análisis descriptivo de la situación histórica de los casos de hantavirus y entregar recomendaciones para una mejor atención y control. Para esto usted trabajara con la tabla de datos Hantavirus_chile.xlsx que cuenta con el registro histórico de casos identificados de esta infección. A partir de esto se le pide realizar las siguientes tareas:"
   ]
  },
  {
   "cell_type": "markdown",
   "id": "2780cc22",
   "metadata": {
    "papermill": {
     "duration": 0.003578,
     "end_time": "2023-08-04T14:45:32.099106",
     "exception": false,
     "start_time": "2023-08-04T14:45:32.095528",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "a. Importe su tabla de datos e indique cuántas infecciones por Hantavirus se han registrado a la fecha. Explique cuál es la unidad de análisis de estos datos ¿La tabla esta compuesta por personas únicas o hay duplicados? Explique que sería un duplicado en este caso. (0.5 puntos)"
   ]
  },
